import{WorkingHoursRepository}from"../../repository/working-hours-repository.min.js";import{MathUtility}from"../../shared/utility/math-utility.min.js";class BeingLateNumberGraphModel{constructor(){const t=new WorkingHoursRepository;this.records=t.getAll()}getActual=()=>{const t=[];for(const r of this.records)t.push({yearMonth:`${r.year}-${r.month}`,value:r.beingLate.count});return t};getEMA=()=>{const t=MathUtility.calculateEMA(this.records.map((t=>t.beingLate.count)),12),r=[];for(let e=0;e<this.records.length;e++)r.push({yearMonth:`${this.records[e].year}-${this.records[e].month}`,value:t[e]});return r};getAverage=()=>{const t=MathUtility.calculateAverage(this.records.map((t=>t.beingLate.count))),r=[];for(const e of this.records)r.push({yearMonth:`${e.year}-${e.month}`,value:t});return r}}export{BeingLateNumberGraphModel};